import './index.css';

// import App from './App/';

function App(props) {
  return (
    <h1> !{props.saludo}, {props.name} </h1>
  )
}

function withWhatever(WrappedComponent) {
  return function ComponenteDeverdad(props)
 {
  return (

    <React.Fragment>
      <WrappedComponent />
    </React.Fragment>
  );
 }
}

const AppWithWhatever = withWhatever(App);


